import React from 'react';

const CapTable = ({ activeSubTab, onSubTabChange }) => {
  const renderContent = () => {
    switch (activeSubTab) {
      case 'overview':
        return (
          <div className="space-y-6">
            <h3 className="text-lg font-medium text-gray-900">Cap Table Overview</h3>
            <p className="text-gray-600">Cap table overview content coming soon.</p>
          </div>
        );
      case 'round-history':
        return (
          <div className="space-y-6">
            <h3 className="text-lg font-medium text-gray-900">Round History</h3>
            <p className="text-gray-600">Round history content coming soon.</p>
          </div>
        );
      case 'shareholders':
        return (
          <div className="space-y-6">
            <h3 className="text-lg font-medium text-gray-900">Shareholders</h3>
            <p className="text-gray-600">Shareholders content coming soon.</p>
          </div>
        );
      case 'scenarios':
        return (
          <div className="space-y-6">
            <h3 className="text-lg font-medium text-gray-900">Exit Scenarios</h3>
            <p className="text-gray-600">Exit scenarios content coming soon.</p>
          </div>
        );
      case 'investment':
        return (
          <div className="space-y-6">
            <h3 className="text-lg font-medium text-gray-900">Investment Planning</h3>
            <p className="text-gray-600">Investment planning content coming soon.</p>
          </div>
        );
      default:
        return (
          <div className="space-y-6">
            <h3 className="text-lg font-medium text-gray-900">Cap Table Overview</h3>
            <p className="text-gray-600">Cap table overview content coming soon.</p>
          </div>
        );
    }
  };

  return (
    <div className="space-y-6">
      <div className="mt-8">
        {renderContent()}
      </div>
    </div>
  );
};

export default CapTable;
